import React from "react";
import { Nav, Image } from "react-bootstrap";

function Header() {
  return (
    <Nav className="d-flex justify-content-between ">
      <Nav.Item>
        <Nav.Link href="/home">Phây Búc</Nav.Link>
      </Nav.Item>

      <Nav.Item className="d-flex justify-content-between ">
        <Nav.Item>
          <Nav.Link href="/home">
            <b>Nguyễn Đăng Phòng</b>
          </Nav.Link>
        </Nav.Item>
        <Image
          src="https://genk.mediacdn.vn/2018/10/19/photo-1-15399266837281100315834-15399271585711710441111.png"
          alt="User Avatar"
          roundedCircle
          style={{ width: "30px", height: "30px" }}
        />
      </Nav.Item>
    </Nav>
  );
}

export default Header;
